I am trying to add an Ad to an AdGroup, but I'm having issues doing so.
I am working with UniversalAppCampaign, so maybe there is a different workflow for this. I couldn't find any example showing how to add a new ad to an existing AdGroup.

Before the new version of the adwords API which introduced AdGroups, I used this code to add a new add from a video's `media_id`:
```
    campaign_service = adwords_client.GetService('CampaignService', version=VERSION)

    operations = [{
        'operator': 'SET',
        'operand': {
            'id': campaign_id,
            'settings': [{
                'xsi_type': 'UniversalAppCampaignSetting',
                'youtubeVideoMediaIdsOps': {
                    'operators': ['UPDATE'],
                },
                'youtubeVideoMediaIds': [media_id],
            }],
        }
    }]

    return campaign_service.mutate(operations)
```

What would be the equivalent to add a new video to an existing AdGroup ?

I have tried the following, but without success:
```
    ad_service = adwords_client.GetService('AdGroupAdService', version=VERSION)

    operations = [{
        'operator': 'ADD',
        'operand': {
            'adGroupId': ad_group_id,
            'xsi_type': 'UniversalAppAd',
            'videos': [
                {
                    'asset': {
                        'xsi_type': 'YouTubeVideoAsset',
                        'youTubeVideoId': video_id,
                    },
                },
            ],
        },
    }]

    return ad_service.mutate(operations)
```

I am getting an error stating that `AdGroupId` is not a valid parameter here.
If I remove this parameter, I get another error `googleads.errors.GoogleAdsServerFault: Unmarshalling Error: cvc-elt.4.3: Type 'ns0:UniversalAppAd' is not validly derived from the type definition, 'AdGroupAd', of element 'ns0:operand'.`
If I try using the `AdService` instead of the `AdGroupAdService`, I get another error `[OperatorError.OPERATOR_NOT_SUPPORTED @ operations[0]]` without further details.

Could you please provide a working example showing how one could add an existing Youtube video to an existing AdGroup (be it from the youtube_id or from the media_id of that video in the campaign)?

