I have encountered a slight performance issue when I submit keyword CPC bids via the client's mutate method, especially when submitting a larger number of operations, such as 5000.
Each keyword bid is formatted as follows:
`{
        'xsi_type': 'AdGroupCriterionOperation',
        'operator': 'SET',
        'operand': {
            'xsi_type': 'BiddableAdGroupCriterion',
            'adGroupId': <adgroup id>,
            'criterion': {'xsi_type': 'Keyword', 'id': <keyword id>},
            'biddingStrategyConfiguration': {
                'bids': [
                    {
                        'xsi_type': 'CpcBid', 'bid': {'microAmount': <micro amount>}
                    }
                ]
            }
        }
    }`

When I profile the code, I notice the following timings (hopefully these are not too abstract to be of use):
transports.py:86(post_xml) - 11.4s (I understand there is not much we can do about this, as this is the time the API is processing the bid upload)
soap.py:57(_create) - 2.14 s
common.py:1252 (_PackArgumentsHelper) - 2.75s
indicators.py:573 (parse_xmlelements) - 1.7s
valueobjects.py:70(__init__) 1.91s

I believe that one of the causes of the slow serialization is due to the number of nested dicts in each Operation that I am using above. Is there a more efficient keyword bid message that could be used instead?

Thanks in advance, and let me know if you need more details.
